const logo = require("../assets/images/logo.png");
const shirtDetails = require("../assets/images/shirt-details.png");
const shirt1 = require("../assets/images/shirt1.png");
const shirt2 = require("../assets/images/shirt2.png");
const shoes1 = require("../assets/images/shoes1.png");
const shoes2 = require("../assets/images/shoes2.png");
const shoes3 = require("../assets/images/shoes3.png");
const shoes4 = require("../assets/images/shoes4.png");

export default {
    logo,
    shirtDetails,
    shirt1,
    shirt2,
    shoes1,
    shoes2,
    shoes3,
    shoes4,
}
